ObjC.import('stdlib');

function run(argv) {
  var input = $.getenv('input');
  let [artist, title] = input.split(" - ");
  var Music = Application('Music');
  Music.play(Music.tracks.whose({artist: {_equals: artist}}).whose({name: {_equals: title}}).first())
}
